// Subir imagen B64 a input file como string
const puppeteer = require('puppeteer');
const fs = require('fs');

(async () => {
  const browser = await puppeteer.launch({ headless: false });
  const page = await browser.newPage();

  // Ir a la URL del HTML servido por Live Server
  await page.goto('http://127.0.0.1:5500/index.html');

  // Imagen en formato base64
//   const base64Image = '/9j/4AAQSkZJRgABAQAAAQABAAD/2wCEAAYGBgYHBgcICAcKCwoLCg8ODAwODxYQERAREBYiFRkVFRkVIh4kHhweJB42KiYmKjY+NDI0PkxERExfWl98fKcBBgYGBgcGBwgIBwoLCgsKDw4MDA4';
    const base64Image = ""
  // Escribir el contenido de la imagen base64 en un archivo temporal
  const fileName = 'temp_image.jpg';
  fs.writeFileSync(fileName, base64Image, 'base64');

  await delay(2000);
  // Esperar a que el campo de entrada de archivos est presente y visible
  await page.waitForSelector('input[type=file]');

  // Seleccionar el campo de entrada de archivos y establecer el archivo
  const fileInput = await page.$('input[type=file]');
  await fileInput.uploadFile(fileName);

  // Esperar 2 segundos
  await delay(2000);

  // Eliminar el archivo temporal
//   fs.unlinkSync(fileName);

  // Cerrar el navegador al finalizar
  // await browser.close();
})();

function delay(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}
